def humanDetector(video):
    # initalize the HOG descriptor and person detector
    hog = cv2.HOGDescriptor()
    hog.setSVMDetector(cv2.HOGDescriptor_getDefaultPeopleDetector())
    picks = []
    for i,frame in enumerate(video):
        img = frame
        if i % 2 == 0:
            print(i)
            # detect the people in the image
            (rects,weights) = hog.detectMultiScale(img,winStride=(8,8),padding=(16,16),scale=1.1)
            # draw the original bounding boxes
            rects = np.array([[x,y,x+w,y+h] for (x,y,w,h) in rects])
            pick = non_max_suppression(rects,probs=None,overlapThresh=0.65)
        picks.append(pick)
    return picks

def genIBB(boundingBoxes):
    bbs = boundingBoxes
    i = 0
    ibbList = []
    while i+64 < len(bbs):
        bbList = bbs[i:i+64]
        bb0 = np.array([bb[0][0] for bb in bbList],dtype=np.uint16)
        bb1 = np.array([bb[1][0] for bb in bbList],dtype=np.uint16)
        bb0_mean = np.mean(bb0,axis=0).astype(np.uint16)
        bb1_mean = np.mean(bb1,axis=0).astype(np.uint16)
        ibb = [int(bb0_mean[0]),int((bb0_mean[1] + bb1_mean[1])/2),int(bb1_mean[2]),int((bb0_mean[3] + bb1_mean[3])/2)]
        ibbList.append([bb0_mean,bb1_mean,ibb])
        i+=8
    return np.array(ibbList)

def dispIBB(vIn,bbInitFrmNo,ibbList):
    bbStartFrmNo = bbInitFrmNo
    for ibb in ibbList:
        print(bbStartFrmNo)
        print(ibb)
        vplay = vIn[bbStartFrmNo:bbStartFrmNo+64,ibb[1]:ibb[3],ibb[0]:ibb[2]]
        vpp.videoPlay(vplay)
        bbStartFrmNo += 8 
    
def pred_IBB(video,ibbLists,bbInitFrmNo,sess,c3d): 
    pred_yList = []
    bbStartFrmNo = bbInitFrmNo
    for ibbList in ibbLists:
        for ibb in ibbList:
            vChop = video[bbStartFrmNo:bbStartFrmNo+64,ibb[1]:ibb[3],ibb[0]:ibb[2]]
            vChop = vpp.videoProcessVin(vChop, (112,128,3), downSample = 2, NormEn=True, RLFlipEn=False)
            vChop_det = np.reshape(vChop,(3,1,16,112,128,3))
            prob = c3d.evaluateProb(vChop_det, sess)
            pred_y = np.argmax(prob)
            top2y = [np.argsort(prob[0])[-1],np.argsort(prob[0])[-2]]
            if pred_y != 6:
                pred_yList.append([bbStartFrmNo,ibb,top2y])
                print(bbStartFrmNo,'+++++++++',ibb,'----- Label is ', top2y)
        bbStartFrmNo += 8
    return pred_yList
            
def comb_IBB(pred_yList):           
    ibbSets = []
    startingFrameNo = pred_yList[0][0] 
    ibbList = []
    yList = []
    for i in range(len(pred_yList)):
        endingFrameNo = pred_yList[i][0] + 63
        ibbList.append(pred_yList[i][1])
        yList.append(pred_yList[i][2])
        if pred_yList[min(len(pred_yList)-1,i+1)][0] - pred_yList[i][0] > 8 or i == len(pred_yList)-1:
            ibbSets.append([[startingFrameNo,endingFrameNo],ibbList,yList])
            if (i < len(pred_yList) - 1):
                startingFrameNo = pred_yList[i+1][0]
                ibbList = []
                yList = []
    print(ibbSets)
    return ibbSets
    
def NMS_IBB(ibbSets):
    from collections import Counter
    ibbs = []
    for ibbSet in ibbSets:
        ibb = np.mean(np.array(ibbSet[1]),0).astype(np.uint16)
        # vote for the most possible label
        ySel = ibbSet[2][int(len(ibbSet[2])/2) - 1: int(len(ibbSet[2])/2 + 2)]
        ySet =[]
        for y in ySel:
            if y[0] !=6:
                ySet.append([y[0]]*11)
            if y[1] !=6:
                ySet.append([y[1]]*9)
        ySet = [item for subList in ySet for item in subList]
        pred_Label = Counter(ySet).most_common(1)[0][0]
        ibbs.append([pred_Label,ibbSet[0][0],ibbSet[0][1],ibb[0],ibb[1],ibb[2],ibb[3]])
    return np.array(ibbs)    

